import React from 'react';
import { Link, BrowserRouter } from 'react-router-dom';

function Navbar() {
  return (
    <BrowserRouter>
      <div className="navbar">
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/about">About</Link>
            </li>
            <li>
              <Link to="/contact">Contact</Link>
            </li>
          </ul>
        </nav>
      </div>
    </BrowserRouter>
  );
}

export default Navbar;
